import AccountBoxIcon from '@material-ui/icons/AccountBox'
import DashBoard from '@material-ui/icons/Dashboard'
import '../CSS/Nav.css'
import { Navbar, Nav, Tab, Row, Col } from 'react-bootstrap'
function Navigation() {
    const handleSelect = (eventKey) => eventKey;

    return (
        <div className='wrapper'>
            <Navbar bg="default" variant='dark' expand='lg' className="sideNav">
                <Navbar.Toggle bg="dark" aria-controls='responsive-navbar-nav' className="optionBox" />
                <Navbar.Collapse id="basic-navbar-nav" className="optionBox" id='Submenu'>
                    <div className="navbar-style">
                        <Nav variant="pills" activeKey='1' className='flex-column' style={{ paddingBottom: '20px' }}>
                            <Nav.Item>
                                <Nav.Link aria-current href='/Portal' eventKey="1" ><DashBoard fontSize='large' className = "tab" />Home</Nav.Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Nav.Link aria-current href='/' eventKey="2" className=''>Testing</Nav.Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Nav.Link><AccountBoxIcon fontSize='large' eventKey="3 " className='' />User Profile</Nav.Link>
                            </Nav.Item>
                        </Nav>
                        </div>
                    </Navbar.Collapse>
                </Navbar>
            </div>



         //!working navbar but no tell of which page you're on
        // <div className='wrapper'>
